import React from "react";
import EmailTwoToneIcon from '@material-ui/icons/EmailTwoTone';

const RouterContact = () => {
    return (
        <>
            <div className="container w-75 mt-5 py-5"  >
                <div className="row contactService">
                    <h1>Contact us for any Suggestions or queries</h1>
                    
                    <div className="col-md-4 col-12 py-3 text-center" >
                        <button type="button" className="btn btn-lg btn-outline-success">Primary button</button>
                    </div>
                    <div className="col-md-4 col-12  py-3 text-center" >
                        <button type="button" class="btn btn-lg btn-outline-danger">Primary button</button>
                    </div>
                    <div className="col-md-4 col-12  py-3 text-center" >
                        <button type="button" class="btn btn-lg btn-outline-secondary">Primary button</button>
                    </div>

                </div>
            </div>
        </>
    );
}

export default RouterContact;
